ign: right;\">&nbsp;</p>\r\n<br />\r\n<div style=\"text-align: center;\"><span style=\"font-size: 22px; font-family: \'comic sans ms\', sans-serif;\"><strong>1. دریافت&nbsp;الیت آف</strong></span></div>\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n<div><span style=\"font-size: 17px; font-family: \'comic sans ms\', sans-serif;\">جهت گرفتن اشتراک در الیت آف در قسمت اشتراک، ایمیل خود را وارد نمایید تا تمام پیشنهادات الیت آف روزانه به ایمیل شما فرستاده شود.</span></div>\r\n<div style=\"text-align: right;\"><span style=\"font-size: 17px; font-family: \'comic sans ms\', sans-serif;\">با چک کردن ایمیل خود به&zwnj;&zwnj;صورت روزانه، مطمئن شوید پیشنهادات فوق&zwnj;العاده ما را از دست نمی&zwnj;دهید، زیرا هر پیشنهاد تنها برای مدت محدودی روی سایت قرار می&zwnj;گیرد. هنگامی که الیت آف خاصی نظر شما را به خود جلب کرد، به سایت الیت آف سر بزنید تا در جریان جزئیات بیشتر خرید قرار بگیرید و در صورتی&zwnj;که همه چیز همانطور که ما تلاش کرده&zwnj;ایم مطلوب شما بود، با عضویت در سایت الیت آف آن را خریداری کنید.</span></div>\r\n<p style=\"text-align: right;\"><span style=\"font-size: 17px; font-family: \'comic sans ms\', sans-serif;\">&nbsp;</span></p>\r\n<div style=\"text-align: center;\"><span style=\"font-size: 22px; font-family: \'comic sans ms\', sans-serif;\"><strong>2. به اشتراک گذاشتن الیت آف</strong></span></div>\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n<div><span style=\"font-size: 17px; font-family: \'comic sans ms\', sans-serif;\">&nbsp;الیت آف&zwnj;ها معمولا اگر به همراه &zwnj;دوستان استفاده شوند لذت بخش&zwnj;تر هستند. پس با استفاده از ایمیل، شبکه های اجتماعی &nbsp;که از طرف سایت الیت آف در اختیار شما قرار داده می&zwnj;شود و البته دنیای مجازی اینترنت، دوستان و آشنایان خود را در جریان قرار دهید تا آنان نیز بتوانند از این فرصت استثنایی استفاده کنند.</span></div>\r\n<p style=\"text-align: right;\"><span style=\"font-size: 17px; font-family: \'comic sans ms\', sans-serif;\">&nbsp;</span></p>\r\n<div style=\"text-align: center;\"><span style=\"font-size: 22px; font-family: \'comic sans ms\', sans-serif;\"><strong>3. خوش گذراندن با الیت آف</strong></span></div>\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n<div><span style=\"font-size: 17px; font-family: \'comic sans ms\', sans-serif;\">پس از خرید،رسید الیت آف خریداری شده کد خرید در قالب&zwnj; یک ایمیل&zwnj; و پیامک در اختیار شما قرار می گیرد. همچنین این فایل از طریق پروفایل شما &nbsp;در سایت الیت آف نیز قابل دسترسی است. شما طی مدت اعتباری که روی الیت آف دریافتی درج شده است، با به همراه داشتن و ارائه یک پرینت از فایل ارسالی و یا ارائه کدهای اختصاصی، می&zwnj;توانید از پیشنهاد و قیمت باورنکردنی الیت آف لذت ببرید.&nbsp;</span></div>\r\n</center>',1,1),(196,19,1,'post','HTML','بدون عنوان','<br><br><center class=tx1>اين صفحه در حال طراحي ميباشد</center><br><br>',1,1),(197,20,1,'post','PHP5','سوالات متداول','<?\r\nfaq_display();\r\n?>',0,1),(200,23,1,'post','HTML','بدون عنوان','<br><br><center class=tx1>اين صفحه در حال طراحي ميباشد</center><br><br>',1,1),(201,24,1,'post','HTML','قوانین و مقرارت الیت آف','<p><br /><br /></p>\r\n<center class=\"tx1\"><span style=\"font-size: 14px;\">مقدمه: کلیه کاربرانی که قصد عضویت و خریداری از سایت الیت آف&nbsp;را دارند، باید مفاد این توافق&zwnj;نامه را کامل مطالعه و سپس اقدام به عضویت و خرید از سایت کنند. عضویت در سایت و یا خرید از آن به منزله مطالعه و قبول شرایط خرید و عضویت و قوانین و مقررات مربوطه است.</span><br /><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 1-</strong>افراد برای عضویت در سایت شرکت و خرید از آن باید در هنگام خرید یا در حالت عادی به قسمت عضویت مراجعه کنند. در این مرحله با وارد کردن اطلاعات لازم مانند نام و نام خانوادگی، رمز عبور و آدرس پست الکترونیکی، لینک تایید عضویت برای آنان ارسال می&zwnj;شود که کاربران با کلیک نمودن آن، مراحل عضویت را تایید می کنند.</span><br /><br /><span style=\"font-size: 14px;\">تبصره 1- تنها اشخاص حقیقی حق عضویت در سایت را دارند.</span><br /><span style=\"font-size: 14px;\">تبصره 2- صرف عضویت در سایت دلیل بر قبول و پذیرش مفاد موافقتنامه بوده و خلاف آن به به هیچ وجه پذیرفته نیست.</span><br /><span style=\"font-size: 14px;\">تبصره 3- کاربر باید رمز عبور و نام کاربری خود را حفظ نموده و چنانچه آن را فراموش کند، می&zwnj;تواند برای ثبت نام مجدد و اخذ کلمه عبور جدید اقدام کند.</span><br /><span style=\"font-size: 14px;\">تبصره 4- کاربر باید آدرس پست الکترونیک خود را به همراه سایر اطلاعات درخواستی به&zwnj;طور صحیح اعلام نموده و مسئولیت ثبت اشتباه و یا خلاف واقع بر عهده شخص کاربر است.</span><br /><span style=\"font-size: 14px;\">تبصره 5- عضویت در سایت شرکت رایگان است.</span><br /><span style=\"font-size: 14px;\">تبصره 6- به دلیل آنکه در برخی از موارد احراز هویت خریدار از طریق نام و نام خانوادگی ارائه شده در سایت امکان&zwnj;پذیر است، مسئولیت هرگونه مغایرت مشخصات فوق با هویت واقعی عضو بر عهده خود افراد بوده و شرکت هیچ&zwnj;گونه مسئولیتی نسبت به مغایرت&zwnj;های احتمالی ندارد.</span><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 2-</strong> کاربر، مسئول حفظ و نگهداری تمام تلفن&zwnj;ها، سخت&zwnj;افزار کامپیوتر و سایر ابزار ضروری برای دسترسی و استفاده از این سایت و تمام هزینه&zwnj;های مرتبط به آن است و شرکت نت&zwnj;برگ مسئول صدمات ناشی از ابزار کاربر نمی&zwnj;باشد.</span><br /><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 3-</strong> افراد بالای 18 سال تمام حقوق عضویت و انجام معامله (خرید) را در سایت شرکت دارند.</span><br /><br /><span style=\"font-size: 14px;\">تبصره 1- عضویت برای افراد بین 15 تا 18 سال با اجازه ولی و یا قیم امکان&zwnj;پذیر و معتبر است. افراد زیر 15سال، حق عضویت در الیت آف&nbsp;را ندارند.</span><br /><span style=\"font-size: 14px;\">تبصره 2- رعایت حکم این ماده و صحت و سقم ارائه اطلاعات بر عهده مشتری (عضو) بوده و شرکت هیچ&zwnj;گونه مسئولیتی در این خصوص ندارد.</span><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 4-</strong> کاربر عضو، پس از عضویت و اخذ رمز و کلمه عبور، حق خرید از سایت را دارد.</span><br /><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 5-</strong> فرایند خرید از سایت توسط کاربر به این شرح است:</span><br /><span style=\"font-size: 14px;\">الف- بازدید از کالاها و خدمات ارائه شده در سایت</span><br /><span style=\"font-size: 14px;\">ب- پرداخت مبلغ تعیینی( یا اعمال تخفیف) به&zwnj;صورت آنلاین به حساب شرکت (انعقاد قرارداد)</span><br /><span style=\"font-size: 14px;\">ج- ارسال رسید کالا و خدمات خریداری شده در قالب ایمیل و یا به&zwnj;صورت پیامک به آدرس پست الکترونیک و یا شماره تلفن همراه کاربر جهت ارائه به تامین&zwnj;کننده کالا و خدمات و دریافت کالا و خدمات از ارائه&zwnj;کننده کالا و خدمت به&zwnj;طور مستقیم</span><br /><span style=\"font-size: 14px;\">تبصره 1- ارسال رسید کالا و خدمات (کوپن تخفیف) بلافاصله و با انجام اولین خرید صورت می گیرد،به جز در مواردی که استفاده از الیت آف به صورت بالذات نیازمند حداقل افراد خریدار باشد (مانند مانند تورهای تفریحی و یا کلاس های آموزشی که نیاز به رسیدن حداقل افراد جهت تشکیل کلاس و یا برگذاری تور می باشند) &nbsp;در صورت به حدنصاب نرسیدن تعداد خریداران در زمان تعیین شده در این موارد، قرارداد بین کاربر عضو و شرکت فسخ و شرکت وجوه واریزی را به&zwnj;صورت اعتباری برای کاربر عضو برای خریدهای آینده در حساب مجازی ویژه&zwnj;ای که برای هر عضو تعیین شده است، نگهداری می&zwnj;کند. چنانچه کاربر عضو قصد استرداد وجوه را داشته باشد، به شرط اعلام حساب خود به شرکت، ظرف مدت حداکثر ۴۸ ساعت وجوه به حساب مشارالیه واریز می&zwnj;شود. همچنین به وجوه مذکور &nbsp;از زمان واریز وجه به حساب های الیت آف تا زمانی که وجوه در نزد الیت آف باشد، هیچگونه سودی تعلق نمی&zwnj;گیرد.</span><br /><span style=\"font-size: 14px;\">تبصره 2- با ارسال رسید کالا و خدمات، کاربر عضو باید در مدت زمان تعیین شده به&zwnj;صورت حضوری (و یا در حالت خاص به&zwnj;صورتی که در هنگام فروش به اطلاع وی رسیده است) به مراجع و مراکز فروش کالا و خدمات مراجعه و از آن رسید استفاده نماید. چنانچه به هر دلیلی کالا و خدمات توسط آن مرکز برای کاربر ارسال شود، هزینه&zwnj;های مربوطه به&zwnj;طور کلی بر عهده شرکت الیت آف نیست.</span><br /><span style=\"font-size: 14px;\">تبصره 3- چنانچه مراکز فروش کالا و خدمات (تامین&zwnj;کننده) به هر نحوی از ارائه کالا و خدمات خودداری کنند، نت&zwnj;برگ مسئولیتی در این زمینه ندارد و مسئولیت جبران خسارت بر عهده تامین&zwnj;کننده کالا و یا خدمات است.</span><br /><span style=\"font-size: 14px;\">تبصره 4- شرکت هیچگونه مسئولیتی در قبال کیفیت، کمیت و شرایط کالای فروخته شده ندارد.</span><br /><span style=\"font-size: 14px;\">تبصره 5- در صورتی که مهلت تعیین&zwnj;شده برای استفاده از کوپن کالا و خدمات به اتمام رسد و مشتری در طول این مدت به مراکز مربوطه مراجعه ننماید، شرکت مسئولیتی در قبال عدم مراجعه مشتری نداشته و وجه واریزی مسترد نمی&zwnj;شود.</span></center>\r\n<div><span style=\"font-size: 14px;\">تبصره 6- پس از اتمام عملیات خرید، امکان انصراف از خرید به هیچ وجه برای خریدار امکان پذیر نمی باشد.</span><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 6-</strong> شرکت اطلاعات زیر را به&zwnj;منظور آگاهی کاربر در اختیار آنان قرار می&zwnj;دهد:</span><br /><br /><span style=\"font-size: 14px;\">الف- مشخصات فنی و ویژگی&zwnj;های کاربردی کالا و یا خدمات طبق قانون.</span><br /><span style=\"font-size: 14px;\">ب- هویت تامین&zwnj;کننده نام تجاری و نشانی وی که تحت عنوان آن به فعالیت مشغول است.</span><br /><span style=\"font-size: 14px;\">ج- تعیین کلیه هزینه&zwnj;هایی که برای خرید کالا بر عهده مشتری است.</span><br /><span style=\"font-size: 14px;\">د- مدت زمان اعتبار پیشنهاد ارائه شده</span><br /><span style=\"font-size: 14px;\">ه- حداقل افرادی که باید پیشنهاد روز را خریداری کنند تا تعداد خریداران به حداقل افراد موردنظر برسد.</span><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 7-</strong> رسید&zwnj;های کالا و خدماتی که پس از خرید برای کاربران عضو ارسال می&zwnj;شود دارای نام و مشخصات است اما کاربر عضو باید از رسید و یا کد دریافتی مراقبت نماید و چنانچه به هر دلیلی آن رسید مربوطه مفقود شود و یا شخص دیگری از آن استفاده کند، شرکت در این زمینه هیچ مسئولیتی ندارد.</span><br /><br /><span style=\"font-size: 14px;\">تبصره 1- نام چاپ شده روی رسید، نامی است که کاربر در زمان عضویت به شرکت ارائه داده است. بنابراین شرکت کسب&zwnj;و&zwnj;کار نوین ایرانیان در خصوص هرگونه مغایرت نام با هویت واقعی خریدار مسئولیتی ندارد و درصورت بروز هرگونه مغایرت، خریدار حق استفاده از رسید خود را نخواهد داشت.</span><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 8-</strong> اختلال در سرویس اینترنت و یا هر رویدادی که باعث شود ایمیل حاوی کد خرید از شرکت به کاربر نرسد موجب از بین رفتن حق کاربر نمی&zwnj;شود. همچنین شرکت مسئولیتی در قبال خرابی&zwnj;ها و یا عدم سرویس&zwnj;دهی به دلیل اختلال در سرویس اینترنت و سایر زیرساخت های مورد نیاز ندارد.</span><br /><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 9-</strong> به منظور تعمیرات دوره&zwnj;ای این سایت به&zwnj;طور موقت غیرقابل دسترس می&zwnj;شود و کاربران حق اعتراض ندارند.</span><br /><span style=\"font-size: 14px;\">تبصره 1- شرکت این حق را داشته که در هر زمان کلیه فعالیت&zwnj;های سایت را متوقف نموده و با پرداخت باقی مانده حساب اعضا کلیه فرآیندهای سایت و فعالیت&zwnj;های مربوطه را به&zwnj;طور دائمی متوقف نماید و کاربر عضو حق هیچگونه اعتراضی نسبت به این امر را ندارد.</span><br /><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 10-</strong> تولید غیرقانونی- فروش و یا تجارت رسید کالا و خدمات که توسط شرکت ارسال شده ممنوع است و طبق مقررات قانونی با اقدام&zwnj;کننده آن برخورد می&zwnj;شود.</span><br /><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 11-</strong> چنانچه حسب مورد به جای ایمیل از طریق پیام کوتاه و یا سند کاغذی استفاده شود در این صورت اسناد کاغذی و یا پیام کوتاه به جای پست الکترونیک اثری بر حقوق و تعهدات کاربر عضو ندارد.</span><br /><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 12-</strong> شرکت از کلیه اطلاعات کاربران عضو اعم از اطلاعات دریافتی و ارسالی، (Backup) تهیه نموده و از آن نگهداری می&zwnj;کند تا در صورت بروز هرگونه خطری برای یک نسخه، نسخه دیگر مصون بماند.</span><br /><br /><br /><span style=\"font-size: 14px;\"><strong>ماده 13-</strong> کاربر نباید در سایت ( تالار گفت&zwnj;وگو و یا هر قسمت دیگر) اظهاراتی (Comment ) را بگذارد و&zwnj; یا اقدامی نماید که مبین نقض حقوق اشخاص دیگر باشد و یا عمل مجرمانه&zwnj;ای را به دنبال داشته باشد. همچنین کاربران نباید در خصوص امور مذهبی و سیاسی در این سایت اظهار نظر کنند. چنانچه هر یک از کاربران این ماده را رعایت نکنند، بلافاصله از سایت اخراج شده و چنانچه خریدی انجام داده باشند، وجه واریزی به آنان مسترد نمی شود. همچنین کاربر (عضو) حق استفاده از این سایت را برای هرگونه عمل تجاری از دست می&zwnj;دهد.</span></div>\r\n<p><br /><br /></p>',1,1),(202,25,1,'post','HTML','ضوابط حفظ حریم خصوصی','<p><br /><br /></p>\r\n<center class=\"tx1\"></center>\r\n<p><span style=\"font-size: 20px; color: #ff0000;\">ضوابظ حفظ حریم خصوصی</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14px;\">سیاست اصلی و استراتژی الیت آف بر حفظ و نگهداری اطلاعات خصوصی کاربران و اعضا بنا نهاده شده است و بر همین اساس کلیه سیاست&zwnj;ها و تصمیم&zwnj;گیری&zwnj;های مربوطه در راستای حفظ حریم و اطلاعات خصوصی اعضا و کاربران است.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14px;\">تیم الیت آف در راستای احترام به حقوق کاربران موارد زیر را به&zwnj; عنوان سیاست&zwnj;های کلی حفظ حریم خصوصی کاربران و اعضای خود مدنظر قرار داده است:</span></p>\r\n<ol>\r\n<li>\r\n<p><span style=\"font-size: 14px;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 14px;\"><strong>شماره 1:</strong> هدف اصلی از جمع&zwnj;آوری اطلاعات اعضا، تنها به دلیل ارائه خدمات منحصر به فرد الیت آف است تا ما بتوانیم با داشتن اطلاعاتی از قبیل نام و نام خانوادگی، شماره تلفن، ایمیل و آدرس پستی امنیت الیت آف&zwnj;های ارسالی را به طرز قابل توجهی ارتقا داده و در صورت وقوع هر پیشامدی، خریدار الیت آف قابل شناسایی باشد. همچنین الیت آف در صدد است با برقرای ارتباط با شما، بهترین پیشنهادات خرید را به شما اطلاع دهد تا بتوانید بهترین استفاده را از خدمات ما داشته باشید. بدیهی است الیت آف از اطلاعات کاربران و اعضای خود تنها برای ارائه خدمات تشویقی و برقراری ارتباط با آنان برای ارسال خدمات و کالا&zwnj;های خریداری شده استفاده می&zwnj;کند.</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: 14px;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 14px;\"><strong>شماره 2:</strong> الیت آف بر خود واجب می&zwnj;داند که با تمام قوا و توان از کلیه اطلاعات شخصی و خریدهای شما به&zwnj;عنوان عضو سایت حفاظت نموده و این اطلاعات را جز با مجوز مقامات قضایی در اختیار شخص حقیقی یا حقوقی ثالثی قرار ندهد.</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: 14px;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"font-size: 14px;\"><strong>شماره 3:</strong> به&zwnj;طور پیش&zwnj;فرض، در هنگام عضویت در الیت آف آدرس پست الکترونیکی شما دریافت شده، ایمیلی برای شما ارسال و از شما تقاضا می&zwnj;شود تا با تایید آن، به جمع اعضای الیت آف بپیوندید. بدون تایید شما، به هیچ وجه عضویت شما تکمیل نشده و الیت آف&zwnj;های روزانه و سایر ایمیل&zwnj;های الیت آف برای شما ارسال نمی&zwnj;شود. همچنین در زمانی که شما آدرس پست الکترونیک خود را تنها برای اطلاع از الیت آف&zwnj;های روزانه در اختیار ما قرار می&zwnj;دهید، الیت آف برای شما تنها ایمیل&zwnj;های اطلاع&zwnj;رسانی پیشنهادات روز را ارسال می&zwnj;کند.</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: 14px;\"><strong>شماره 4:</strong> کاربران و اعضای سایت در هر زمان که اراده نمایند قادرند اطلاع&zwnj;رسانی پیشنهادات روزانه و یا سایر ایمیل&zwnj; هایی را که از سوی شرکت به ایشان ارسال می&zwnj;شود، متوقف نموده و بعد از آن دیگر ایمیلی از طرف الیت آف به آنان ارسال نمی&zwnj;شود.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14px;\">جهت پرسش هرگونه سوالی درخصوص حریم کاربران در الیت آف، با ما تماس حاصل نمایید: info@elitoff.com</span></p>\r\n</li>\r\n</ol>',1,1),(205,1,2,'post','PHP5','لیست آخرین ها','<?\r\nnb_list();\r\n?>',0,1),(206,1,3,'post','PHP5','آخرین های گروه ها','<?\r\nnb_list_cats();\r\n?>',0,1);
