یو انجام شود</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; بدون درد و سوختگی</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; پایین بودن تعداد جلسات معالجه به دلیل اثربخشی بسیار بالا</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; با مجوزاز وزارت بهداشت و درمان</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&nbsp;<img src=\"http://grovo.ir/images/EditorUpload/hghg7k7asas7.jpg\" alt=\"\" width=\"391\" height=\"434\" vspace=\"5\" /></span></p>','<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; لطفا پیش از خرید شرایط استفاده را به دقت مطالعه کنید</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; اعتبار الیت آف: از 24ساعت پس از خرید&nbsp;الی 30دی94</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; هر الیت آف مخصوص یک نفر و یک بار استفاده از خدمات</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\"><strong>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; الیت آف های خریداری شده تنها در 4 جلسه قابل استفاده میباشد</strong></span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; امکان خرید الیت آف جهت هدیه دادن به دوستان</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; برای استفاده کافیست شماره مشتری و الیت آف دریافتی را به پذیرش ارائه دهید<span dir=\"LTR\">.</span></span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>زمان مراجعه</strong> (با رزرو قبلی): همه روزهای هفته از ساعت 10 الی 13:30 و 17 الی 21</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; الیت آف عزیز،لطفاً استفاده از الیت آف خود را به روزهای پایانی موکول نفرمایید</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\"><strong>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; مراجعه تنها با هماهنگی و رزرو قبلی از طریق تماس تلفنی</strong></span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; خریداران محترم لطفا <strong>3روز قبل مراجعه</strong>، نسبت به رزرو و تعیین وقت خود اقدام نمایند<span dir=\"LTR\">.</span></span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; قبل از تهیه الیت آف بررسی های لازم را به عمل آورید.</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; الیت آف های خریداری شده به هیچ عنوان قابل استرداد نمی باشند<span dir=\"LTR\">.</span></span></p>','','data/netbarg/37/0-e0d608e3603626870ce85e3677a26a2e.jpg','1,11,122,1603,1973','36.326259106300874,59.54098463058472','دکتر دری','مشهد – بین استقلال 1 و 3- پلاک 53 – مطب اقای دری','36043434-36058538',0,0),(38,'حس خوب آرامش با ماساژ سوئدی در خانه ماساژ',2,18000,40000,1450826046,1474416000,'<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ویژه اقایان&nbsp;و بانوان</span></p>\r\n<div>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\"><strong>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ماساژ سوئدی یکی از اصیل ترین و پایه ای ترین سبک های ماساژ در جهان است</strong></span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>مدت زمان</strong> : <u><strong>30دقیقه</strong></u></span></p>\r\n</div>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; رفع نقاط درد</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; رفع کرامپ و اسپاسم</span></p>\r\n<div>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\"><strong>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; امکان گرفتن دوش آب گرم</strong></span></p>\r\n<span style=\"font-size: 14px;\">&nbsp;</span></div>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; کاهش استرس و اضطراب</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; کاهش دردهای کهنه (درد زانو، ساق، کتف، شانه، گردن و کمر)</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; رفع کم خوابی</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; رفع مشکلات گوارشی از جمله یبوست</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; تعدل در فشار خون</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; بهبود بخشیدن گردش خون و جریان لنفاوی</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; تقویت سیستم ایمنی بدن</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; تجربه ای متفاوت و فراموش نشدنی</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; دفع سموم و چربی ها</span></p>\r\n<p dir=\"RTL\"><span style=\"font-size: 14px;\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; رفع خستگی های مزمن و ایجاد شادابی و نشاط</span></p>','<p><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; لطفا شرایط استفاده را به دقت مطالعه کنید</span></p>\r\n<ul>\r\n<li><span style=\"font-size: 14px;\">اعتبار : از لحظه خرید&nbsp;لغایت 30دی&nbsp;94</span></li>\r\n<li><span style=\"font-size: 14px;\">هر برای یک نفر، جهت استفاده از ۳۰ دقیقه ماساژ سوئدی در خانه ماساژ میباشد.</span></li>\r\n<li><span style=\"font-size: 14px;\">هر نفر در هر بار مراجعه حداکثر از یک میتواند استفاده کند.</span></li>\r\n<li><span style=\"font-size: 14px;\"><strong> هر نفر حداکثر مجاز به خرید 3 </strong></span></li>\r\n<li><span style=\"font-size: 14px;\">برای استفاده کافیست <em>شماره مشتری&nbsp; و الیت آف</em>&nbsp;را به پذیرش ارائه دهید.</span></li>\r\n<li><span style=\"font-size: 14px;\"><strong> مراجعه فقط با هماهنگی و رزرو قبلی از طریق تماس تلفنی</strong></span></li>\r\n<li><span style=\"font-size: 14px;\">خریداران محترم لطفا <strong>3روز قبل مراجعه</strong>، نسبت به رزرو و تعیین وقت خود اقدام نمایند.</span></li>\r\n<li><span style=\"font-size: 14px;\"> های خریداری شده به هیچ عنوان قابل استرداد نمی باشند.</span></li>\r\n<li><span style=\"font-size: 14px;\">گرُوُیی عزیز،لطفاً استفاده از خود را به روزهای پایانی موکول نفرمایید</span></li>\r\n<li><span style=\"font-size: 14px;\"><strong>ساعت مراجعه</strong>: (با رزرو قبلی) همه روزهای هفته بجز ایام تعطیل از 15 الی 22</span></li>\r\n</ul>','','data/netbarg/38/0-50b9f430f3463ba7cad9290ef3a15bb6.jpg','1,11,122,1603,1968','36.29620760290818,59.573750495910645','خانه ماساژ','شهد – میدان احمد آباد ، بلوار طالقانی، روبروی طالقانی 1 ، خانه ماساژ','09150406905',0,0),(39,'تست پرداخت',1,200,350,1468536014,1468580400,'<p>ویژگی تست</p>','<p>شرایط تست</p>','<p>توضیحات تست</p>','data/netbarg/39/0-41c6c9f35f3e3fdcfe591168323542b0.jpg','1,11,122,1603,1958','36.28980849179811,59.61155891418457','آزمایشی','آدرس فروشنده','09124443322',1,0);
